// src/pages/Contact.jsx
export default function Contact() {
  return (
    <div className="py-20 px-6 max-w-2xl mx-auto">
      <h1 className="text-5xl font-bold text-center mb-12">Contact Us</h1>
      <form className="space-y-6 bg-white p-10 rounded-xl shadow-lg">
        <input type="text" placeholder="Your Name" className="w-full p-4 border rounded-lg" />
        <input type="email" placeholder="Your Email" className="w-full p-4 border rounded-lg" />
        <textarea placeholder="Your Message" rows="6" className="w-full p-4 border rounded-lg"></textarea>
        <button type="submit" className="w-full bg-blue-600 text-white py-4 rounded-lg font-bold hover:bg-blue-700">
          Send Message
        </button>
      </form>
    </div>
  );
}
